import React from "react";
import './App.css';
class App extends React.Component {

	// Constructor
	constructor(props) {
		super(props);

		this.state = {
			items: [],
			DataisLoaded: false
		};
	}

	// ComponentDidMount is used to execute the code
	componentDidMount() {
		fetch("http://localhost:8080/restapi/trainings")
			.then((res) => res.json())
			.then((json) => {
				this.setState({
					items: json,
					DataisLoaded: true
				});
			})
	}

	render() {
		const { DataisLoaded, items } = this.state;
		if (!DataisLoaded) return <div className = "App-header">
			<h2> Welcome to training hub! </h2>
			<p className="App-link"> Loading... </p> </div> ;

		return (
		<div className = "App-header">
			<h2> Welcome to training hub! </h2> {
				items.map((item) => (
				<ol key = { item.id } className= "App-link">
					Name: { item.name },
					Username: { item.distance},
					Email: { item.duration}
					</ol>

				))
			}
      <p>CS3219 OTOT Task B4</p>
		</div>
	);
}
}

